DROP TABLE IF EXISTS `goodsproduct`;
CREATE TABLE `goodsproduct`  (
  `id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品编号',
  `classify_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '-商品分类表-外键',
  `title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品标题',
  `variety` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品品种',
  `desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品描述',
  `store` enum('0','1','2') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1' COMMENT '储存条件 \'0冷藏\',\'1常温\',\'2冷冻\'',
  `weight` int NOT NULL COMMENT '规格重量',
  `classify` enum('新鲜蔬果','休闲零食','水产虾蟹','酒水乳饮','粮油调味','品牌家电','个人百货','美妆个护') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品分类',
  `category` enum('蔬菜','水果','肉类','蛋类','家禽类','酒','饮品','矿泉水','食用油','调味品','小家电','大家电','纸巾','服饰','化妆品','手机','百货') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品类别',
  `isRecommend` enum('是','否') CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '是' COMMENT '是否推荐,1-是，0-否',
  `unit` enum('g','kg','mg') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'g' COMMENT '重量单位',
  `recommendResult` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '推荐理由',
  `originalPrice` decimal(10, 2) NOT NULL COMMENT '商品原价',
  `nowPrice` decimal(10, 2) NOT NULL COMMENT '商品现价',
  `state` enum('0','1') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '商品状态 0已上架 1已下架',
  `isFlashSale` enum('1','0') CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '1' COMMENT '是否限时抢购,1-是，0-否',
  `flashSalePrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '限时抢购价格',
  `startDate` datetime NULL DEFAULT NULL COMMENT '开始抢购时间',
  `endDate` datetime NULL DEFAULT NULL COMMENT '结束抢购时间',
  `isGreenDiscounts` enum('1','0') CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '1' COMMENT '是否绿卡优惠,1-是，0-否',
  `greenPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '绿卡价格',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `classify_id`(`classify_id`(4) ASC) USING BTREE,
  INDEX `classify_id_2`(`classify_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = COMPACT;

